import React from "react";

const cell = {
  value: 9,
  prefilled: false,
};

const grid = () => {
  for (let row = 0; row < 18; row++) {
    grid.push([]);
    for (let col = 0; col < 10; col++) {
      grid[row].push(<GridSquare key={`${col}${row}`} color="1" />);
    }
  }
};

const Grid = () => {
  return (
    <article>
      <div>{grid}</div>
    </article>
  );
};

export default Grid;
